    color: rgb(234,156,094);
    font-family: UhBeeZZIBA-Regular;
    font-size: 1.5rem;
    letter-spacing: 5px;
    text-decoration: none;

`;

const Contents = styled.div`
    background: white;
    padding: 2rem;
    height: auto;
    font-family: UhBeeZZIBA-Regular;
`;

const Button = styled.button`
    width: 92%;
